import React from 'react'
import { NavLink, Outlet } from 'react-router-dom';

export default function NavRouter() {
  return (
    <div>
        {}
      <NavLink to="/home">Home</NavLink>
      <NavLink to="/about">About</NavLink>
      <NavLink to="/contact">Contact</NavLink>
      <Outlet />
    </div>
  );
}
